import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/navigator.css';

export const Navigator = () => {
  return (
    <div>
      <div>
        <div>
          <Link to="/share">Share</Link>
        </div>
        <div>
          <Link to="/register">Register</Link>
        </div>
        <div>
          <Link to="/management">Management</Link>
        </div>
      </div>
    </div>
  );
};
